import { supabase } from './supabase';
import { User, UserListItem } from '../types/auth';

export const authService = {
  async signIn(username: string, password: string): Promise<User | null> {
    if (!username || !password) return null;

    try {
      const { data, error } = await supabase
        .rpc('check_password', {
          p_username: username,
          p_password: password
        });

      if (error) {
        console.error('Sign in error:', error);
        throw new Error('Erro ao fazer login. Por favor, tente novamente.');
      }

      if (!data || !Array.isArray(data) || data.length === 0) {
        return null;
      }

      const user = data[0];

      if (!user?.id || !user?.username || !user?.role) {
        console.error('Invalid user data received:', user);
        throw new Error('Dados de usuário inválidos recebidos do servidor');
      }

      const userData: User = {
        id: user.id,
        username: user.username,
        full_name: user.full_name || '',
        role: user.role,
        display_name: user.display_name || user.username
      };

      localStorage.setItem('user', JSON.stringify(userData));
      return userData;

    } catch (error) {
      console.error('Sign in process error:', error);
      throw error instanceof Error ? error : new Error('Erro desconhecido ao fazer login');
    }
  },

  getCurrentUser: async (): Promise<User | null> => {
    try {
      // Verifica se há um usuário no localStorage
      const storedUser = localStorage.getItem('user');
      if (!storedUser) {
        return null;
      }

      // Verifica se o token de autenticação existe
      const authToken = localStorage.getItem('auth_token');
      if (!authToken) {
        localStorage.removeItem('user');
        return null;
      }

      const currentUser = JSON.parse(storedUser) as User;

      // Verifica se o usuário ainda é válido no banco
      const { data, error } = await supabase
        .rpc('get_user_data', {
          p_username: currentUser.username
        });

      if (error || !data || !Array.isArray(data) || data.length === 0) {
        // Limpa todos os dados de autenticação se houver erro
        localStorage.removeItem('user');
        localStorage.removeItem('auth_token');
        return null;
      }

      return data[0];

    } catch (error) {
      // Em caso de erro, limpa todos os dados de autenticação
      localStorage.removeItem('user');
      localStorage.removeItem('auth_token');
      return null;
    }
  },

  signOut: async () => {
    try {
      // Limpa todos os dados de autenticação
      localStorage.removeItem('user');
      localStorage.removeItem('auth_token');
      localStorage.removeItem('loginAttempts');
      localStorage.removeItem('loginBlockedUntil');

      await supabase.auth.signOut();

      return true;
    } catch (error) {
      console.error('Erro ao fazer logout:', error);
      throw error;
    }
  },

  async changePassword(username: string, adminPassword: string, newPassword: string): Promise<boolean> {
    try {
      if (!username || !adminPassword || !newPassword) {
        console.error('Dados inválidos:', { 
          hasUsername: !!username, 
          hasAdminPassword: !!adminPassword, 
          hasNewPassword: !!newPassword 
        });
        throw new Error('Todos os campos são obrigatórios');
      }

      // Pega o usuário atual do localStorage
      const currentUser = localStorage.getItem('user');
      if (!currentUser) {
        throw new Error('Usuário não autenticado');
      }

      const user = JSON.parse(currentUser);
      console.log('Usuário atual:', { username: user.username, role: user.role });

      console.log('Tentando alterar senha para usuário:', username);

      console.log('Chamando change_password com:', {
        username,
        adminPassword,
        newPassword
      });

      const { data, error } = await supabase
        .rpc('change_password', {
          p_username: username,
          p_admin_password: adminPassword,
          p_new_password: newPassword
        });

      console.log('Resposta do change_password:', { data, error });

      if (error) {
        console.error('Erro ao alterar senha:', error);
        throw error;
      }

      return data || false;
    } catch (error) {
      console.error('Erro ao alterar senha:', error);
      throw error;
    }
  },

  async updateUsername(currentUsername: string, newUsername: string, adminPassword: string): Promise<boolean> {
    const { data, error } = await supabase
      .rpc('update_username', {
        p_current_username: currentUsername,
        p_new_username: newUsername,
        p_admin_password: adminPassword
      });

    if (error) throw error;
    return data || false;
  },

  async updateDisplayName(username: string, newDisplayName: string, adminPassword: string): Promise<boolean> {
    const { data, error } = await supabase
      .rpc('update_display_name', {
        p_username: username,
        p_display_name: newDisplayName,
        p_admin_password: adminPassword
      });

    if (error) throw error;
    return data || false;
  },

  async listUsers(): Promise<UserListItem[]> {
    try {
      console.log('Chamando list_users no Supabase...');
      const { data, error } = await supabase
        .rpc('list_users');

      console.log('Resposta do list_users:', { data, error });

      if (error) {
        console.error('Erro ao listar usuários:', error);
        throw error;
      }

      return data || [];
    } catch (error) {
      console.error('Erro ao listar usuários:', error);
      throw error;
    }
  },

  async updateUserCredentials(username: string, newUsername: string | null, newPassword: string | null): Promise<boolean> {
    try {
      const { data, error } = await supabase
        .rpc('update_user_credentials', {
          p_username: username,
          p_new_username: newUsername,
          p_new_password: newPassword
        });

      if (error) {
        console.error('Erro ao atualizar credenciais do usuário:', error);
        throw error;
      }

      return data || false;
    } catch (error) {
      console.error('Erro ao atualizar credenciais do usuário:', error);
      throw error;
    }
  }
};
